import React, { Component } from 'react'

//UI组件 不可以有任何redux的API
export default class Count extends Component {
        render() {
          const { value, onIncreaseClick } = this.props
          return (
            <div>
              <span>{value}</span>
              <button onClick={onIncreaseClick}>Increase</button>
            </div>
          )
        }

}
